Kösem consiguió influencia dentro del palacio a través de su matrimonio con el sultán Ahmed I. Su belleza particular ayudó a ganarse el favoritismo de Ahmed y, combinada con su inteligencia, pudo ganar su considerable autoridad e influencia en el palacio entre sus otras esposas.

Tras la muerte de Ahmed en 1617, usó su influencia para apoyar el reclamo de su hermano, Mustafa I, al trono. Se lo consideró mentalmente no apto y Kösem pudo ejercer el poder a través de él, pero fue declarado incompetente y depuesto después de solo tres meses.

Mustafa fue reemplazado por Osman II, el hijo de Ahmed a través de otra esposa, y Kösem fue marginada, pero el reinado de Osman se truncó después de que una revuelta del cuerpo de Janissary en 1622 acabara con su vida. Así, Mustafa fue reinstalado temporalmente.

El hijoj de Kösem, Murad IV, se convirtió en sultán en 1623, lo que le dio a Kösem la prestigiosa posición de valide sultan ("madre del sultán"). Esta poderosa posición había ganado gran autoridad en las últimas generaciones, especialmente cuando la autoridad del gran visir había decaído.

La posición de Kösem era aún más poderosa porque disfrutó de una regencia completa durante los primeros cinco años del reinado de Murad, cuando aún era menor de edad. Cuando llegó a la mayoría de edad, gobernó con mano dura, pero en ocasiones se sabía que consideraba las opiniones de su madre. Continuó gobernando hasta su muerte en 1640.

El trono luego fue a İbrahim, también hijo de Kösem. Su gobierno estuvo marcado por la negligencia y la mala gestión luego de que Kösem perdiera la audición y abandara el palacio. Aunque ausente del palacio, sus relaciones e influencia en la corte permanecieron intactas. En 1648, con el imperio en un estado triste, ella y otros funcionarios de la corte conspiraron contra İbrahim, y los jenízaros lo derrocaron.

