I met Dr. Jo Chang,  Nu Skin’s chief scientific officer and executive vice president of Product Development, in a very exclusive event in London. He flew all the way from the US to have this meeting with us, answer our questions and share his vision. It was very exciting and was an honor to meet him in person 🙏

“I don’t want to make a product just because it sounds good. I want to make a product that actually does good,” Joe said. “Anybody can dream up products that are the ‘greatest thing since sliced bread’, but if such ideas aren’t based on scientific discovery, they are not likely to impact lives. That doesn’t inspire me.”

I love his dedication of science and that no harmful ingredients can be in Nu Skin products. As a result he and his team created the ageLOC® technology, allowing Nu Skin to truly refocus on the aging process. The ageLOC technology utilizes gene science to understand the genes related to aging, leading to new insights on developing anti-aging products. The team has now broadened their product development perspectives to include products that are consistent in the new era of social selling. 

This is why joining our team and building a Nu Skin empire is just simply amazing and supported by not just science but technology too. Makes me love our opportunity even more! 

